mapper.select:

select 

from jvd_tenko_baba_jotai
where HAPPYO_TSUKIHI_JIFUN = #{happyoTsukihiJifun,jdbcType=TIMESTAMP}
  and HENKO_SHIKIBETSU = #{henkoShikibetsu,jdbcType=CHAR}
  and KAISAI_CODE = #{kaisaiCode,jdbcType=CHAR}

mapper.delete:

delete from jvd_tenko_baba_jotai
where HAPPYO_TSUKIHI_JIFUN = #{happyoTsukihiJifun,jdbcType=TIMESTAMP}
  and HENKO_SHIKIBETSU = #{henkoShikibetsu,jdbcType=CHAR}
  and KAISAI_CODE = #{kaisaiCode,jdbcType=CHAR}
